import React from 'react'
import PropTypes from 'prop-types'
import fetch from 'isomorphic-unfetch'
import data from '../data.json'
import Section from '../components/Section'

const Homepage = ({ posts, labels }) => {
    return (
        <div className="bg-dark">
            <section className="intro">
                <img className="intro__image" src="/static/images/zuber-intro@2x.png" alt="Steven Zuber" />
                <img className="intro__logo" src="/static/svgs/lion.svg" alt="Zuber Coat Of Arms" />
            </section>

            <Section
                title={ labels.statistics }
                baseClase="statistics"
                images={ {
                    small: "/static/images/sliding-zuber-img.png",
                    medium: "/static/images/sliding-zuber-img@1x.png",
                    large: "/static/images/sliding-zuber-img@2x.png"
                } }
            />
        </div>
    )
}

Homepage.getInitialProps = async () => {
    // const res = await fetch('http://localhost:8888/wordpress/wp-json/wp/v2/posts?category=home', {
    //   method: 'get',
    //   mode: 'no-cors',
    // })
    // const json = await res.json()

    return { posts: data.homepage, labels: data.labels }
};

Homepage.propTypes = {
  posts: PropTypes.shape({})
}

export default Homepage


